INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',10000,3,'Does not directly engage in combat, but rather can act through his allied Heroes and Minions and place Toxic Nests to defend important locations.','Abathur, the Evolution Master of Kerrigan''s Swarm, works ceaselessly to improve the zerg from the genetic level up. His hate for chaos and imperfection almost rivals his hatred of pronouns.',4,true,713,1.48,0,1,0,0,1.43,1,27,0,'Evolution Master');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-10-07',4000,2,'Burrow Charges toward enemies and Impales targets. Regrows carapace to shield himself.','Once a proud nerubian king, Anub''arak dared to stand against the Lich King''s invasion, but despite his bravery, he too fell to the unrelenting Scourge. Resurrected into undeath, the Traitor King now serves as a towering weapon of destruction.',2,true,1925,4.01,500,2,20,0,1,1.5,91,1,'Traitor King');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',7000,2,'Engages with his enemies directly, freezing and slowing them. Uses the power of Frostmourne to empower his attacks.','Once the crown prince of Lordaeron, and prot&#1043;&#169;g&#1043;&#169; of Uther the Lightbringer, Arthas was corrupted by the cursed blade Frostmourne in a bid to save his people. Now he rules over the damned as the Lich King and all shall know his wrath.',2,true,2524,5.2578,500,2,0,10,1,2,95,2,'The Lich King');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-10-07',2000,1,'Uses spells to deny enemy safe places to hide. Summons demons to fight for him.','The Lord of Sin rules over a densely populated land of Hell where both the greatest joys and despair, and the deepest depravities can be experienced. But it is never enough for Azmodan, who has set his eyes on the realm of Sanctuary.',2,false,2848,5.93,500,2,0,0,1,5.5,88,3,'Lord of Sin');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-04-15',7000,2,'A strategic support that can quickly teleport to allies, and Polymorphs enemies.','Like many Faerie Dragons, Brightwing is happiest darting around the forests of Ashenvale, healing friends, and then grabbing a light snack. By the way, did you know a human head only weighs ten pounds? Talk about light!',3,false,1450,3.02,500,2,0,0,1.11,5.5,88,4,'Faerie Dragon');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-09-10',7000,2,'A front-line fighter whose Abilities combo together for extra damage and more powerful effects.','To be a Brewmaster is to be an explorer, a lover of nature, and when the need arises; a powerful fighter. For years Chen Stormstout has wandered the world of Azeroth in search of rare ingredients, stirring stories, and of course, good brew.',3,true,2473,5.1523,100,3,0,0,1.11,2,84,5,'Legendary Brewmaster');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',2000,1,'An aggressive Ability driven Hero that charges his enemies and uses fire and lightning to burn them down. Gathers the souls of fallen enemies to use for resurrection.','Known in the ancient tongue as Al''Diabolos, the Prime Evil of Terror, the Demon Lord Diablo seeks to claim the world of Sanctuary for the Burning Hells. His victims are innumerable, his schemes unknowable, and his gender... malleable.',2,true,2567,5.3515,500,2,0,0,0.91,1.25,105,6,'Lord of Terror');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',2000,2,'A heavy front-line Hero that knocks around and stuns his foes while buffing his allies. Able to leap anywhere on the battlefield.','The Power of the Horde incarnated by brutal rhythms and blistering guitar riffs into the most elite tauren chieftain to ever headbang across the surface of Azeroth. Don''t bother putting on socks. He''s just going to rock them off anyways.',2,true,2180,4.543,500,2,0,0,1.25,1.5,103,7,'Rock God');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',7000,2,'Able to strike enemies from afar and Fly to distant parts of the battlefield.','Falstad is the High Thane of the Wildhammer Clan and a founding member of the Council of Three Hammers that presides over Ironforge. Despite speculation, Falstad has never been dead and anyone who claims such is a liar.',2,false,1365,2.84,500,2,0,0,1.43,5.5,104,8,'Wildhammer Thane');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',2000,2,'Specializes in zoning out his enemies and securing areas with Turrets and XPlodium Charges. Can supercharge his Deth Lazor for increased area of effect damage.','Few would consider Gazlowe a fighter, but what he lacks in height, he makes up in mechanical know-how. Besides, you don''t get to be boss of a &quot;boom&quot;-town like Ratchet with just a charming personality, if you know what I mean.',2,true,1900,3.95,500,2,0,0,1.25,1.2,99,9,'Boss of Ratchet');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,2,'Darts around the battlefield, evading attacks and relentlessly pursuing enemies.','Illidan Stormrage, the first Demon Hunter, betrayed his people and created a new Well of Eternity after the demonic invasion of Azeroth. Now Illidan lords over Outland slaying unsuitably prepared Heroes who venture into his domain.',3,true,1650,3.44,0,1,0,0,1.82,1.2,78,10,'The Betrayer');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-12-02',4000,2,'Has multiple area of effect damage spells. Slows and freezes her enemies.','Once the apprentice of the Archmage Antonidas, Jaina Proudmoore led the survivors of Lordaeron to Kalimdor and founded the city of Theramore. Now, she serves the Alliance as a powerful voice fighting for reason and diplomacy.',2,false,1365,2.84,500,2,0,0,1,5.5,60,11,'Archmage');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-06-02',4000,1,'A front-line fighter that is resilient and can make herself immune to enemy crowd control.','There have been many women who have borne the name Johanna in service of the crusade, and each has given her life to purify her faith. Johanna carries on their legacy as she searches the kingdom of Khanduras for the fallen star.',2,true,2179,4.54,500,2,0,25,0.91,1.5,103,12,'Crusader of Zakarum');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-05-12',7000,2,'A fire mage capable of empowering his Abilities in unique ways and dealing area of effect damage.','Like all Blood Elves, Prince Kael''thas was transformed by the fall of Quel''thalas. Desperate to save his people from being consumed by their magical addiction, he joined forces with the Burning Legion and now lords over Tempest Keep.',3,false,1520,3.17,500,2,0,0,1.11,5.5,65,13,'The Sun King');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,3,'An aggressive Hero that gains temporary Shields by attacking enemies and using her Abilities. Able to stun enemies and pull them towards her.','Once a terran ghost with formidable psionic abilities, Sarah Kerrigan was betrayed by her allies and transformed into the Queen of Blades. Now freed of the dark one''s corruption, Kerrigan faces a threat that could destroy the galaxy itself.',3,true,1680,3.5,500,2,0,0,1.25,2,120,14,'Queen of Blades');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-08-18',7000,1,'A versatile support that can be either a healer or a fighter depending where the need is greatest.','To the monks of Ivgorod, the gods are in all things, and their divine will is proclaimed by the Patriarchs. With unshakable faith, Kharazim carries forth the decrees of the thousand and one gods to the ends of Sanctuary and the realms beyond.',2,true,2027,4.22,500,2,0,0,2,1.8,60,15,'Veradani Monk');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-07-21',7000,1,'A slow moving front-line warrior that never truly dies, haunting the battlefield as a ghost before reforming on the field.','Madness. Betrayal. Death. These are the legacy of the Black King Leoric''s reign. Driven to madness by the spirit of Diablo, Leoric brought untold suffering on his kingdom. Even after his death there was no release for the Skeleton King.',1,true,2567,5.35,500,2,0,0,0.77,2,109,16,'The Skeleton King');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-04-15',2000,2,'A positional support that protects her allies by throwing out Healing Brew and blinding enemies.','Born upon Shen-zin Su, the Wandering Isle, Li Li Stormstout led an uneventful life until she began reading her uncle Chen''s journals. Soon, nothing would sate her desire for adventure, exploration, and pestering adventurers around Halfhill.',1,false,1615,3.36,500,2,0,0,1.25,5.5,66,17,'World Wanderer');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',2000,2,'Heals allies and restores their Mana. Able to reveal and root groups of enemies from a distance.','Malfurion Stormrage is the greatest druid on Azeroth, and a student of the demi-god Cenarius. Communing with nature and Cenarius through the Emerald dream, Malfurion protects the wilds from demonic influences.',1,false,1525,3.18,500,2,0,0,1.11,5.5,60,18,'Archdruid');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,2,'Jumps around the battlefield and stuns Heroes. Rapidly regenerates Health as he nears death.','Once a mentor to Prince Arthas, Muradin was unable to prevent his corruption. After recovering from a mild case of amnesia, he is now the leader of the Bronzebeard clan after the &quot;diamond-ization&quot; of his brother King Magni.',2,true,2876,5.99,500,2,0,0,1.11,1,88,19,'Mountain King');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-05-22',7000,2,'Slimes enemies and spits out Pufferfish.  Can revive from his Egg.','Mrgglglbrlg rmrmgllg mrggggm. Mrrglglgy, mgllglgl mgggrrmgl? MRGGGLGLLM! Mrrggllgggllggll mrrglrlg mrrg mrrg mrrrg.',3,true,730,29.2,0,1,0,0,1.25,1.2,62,20,'Baby Murloc');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,1,'Effective against groups of enemies by summoning Spiders, Zombies, and Frogs.  Siphons Health and Mana from dying foes.','With cabalistic incantations and vestments of feather and bone, the Witch Doctor Nazeebo calls upon spirits from the Unformed Land to aid him. Few outlanders encounter a Witch Doctor in the flesh, without losing their own.',2,false,1502,3.13,500,2,0,0,1.11,5.5,88,21,'Heretic Witch Doctor');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',7000,3,'Automatically cloaks while out of combat. Snipes enemies from afar, and creates Decoys of herself to fool enemies.','November &quot;Nova&quot; Terra is a ghost of the Terran Dominion and one of the most powerful psionic soldiers ever known. Nova is highly focused, determined, and extremely deadly. Even Jim Raynor wouldn''t want to be caught in her crosshairs.',2,false,1300,2.71,500,2,0,0,1,6.5,105,22,'Dominion Ghost');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',2000,3,'A resilient Hero that knocks back enemies and buffs allies. Able to regenerate Health quickly when in trouble.','Ex-Confederate Marshal James Raynor has stood against whatever the universe can throw at him and survived. He stands as a beacon of hope among enigmatic aliens and monsters, fighting for justice in a cold uncaring universe.',1,false,1302,2.71,500,2,0,0,1.25,6.5,122,23,'Renegade Commander');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-07-23',7000,2,'Transforms into a spirit wolf instead of mounting. Slows enemies, heals allies, and grants them a damaging shield.','Rehgar Earthfury has seen his share of combat, both as a gladiator, and a master of his own team. Now, having put that life aside, he serves as a simple shaman of the Earthen Ring, earning his redemption by healing the lands of Azeroth.',2,true,2132,4.44,500,2,0,0,1.25,1.5,125,24,'Shaman of the Earthen Ring');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',7000,3,'Can Siege up gaining increased range and adding splash damage. Deals more damage to distant targets.','Sergeant Bama &quot;the Hammer&quot; Kowalski has served some of the toughest tours around the Koprulu sector. The roar of her siege tank''s shock cannon strikes fear right into the heart of the toughest of warriors... including some of her allies.',3,false,1720,3.6,500,2,0,0,1,5.5,140,25,'Siege Tank Operator');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,1,'A direct fighter who uses Fury instead of Mana. Leeches life from enemies by attacking and using Abilities.','From the frozen Dreadlands of the north come the mighty Barbarian warriors. After surviving the destruction of her home and death of her tribe, Sonya wanders Sanctuary in search of battle and a better life for her people.',2,true,2435,5.08,100,5,0,0,1.25,1.5,84,26,'Wandering Barbarian');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',7000,2,'A heavy front-line fighter that can use Hook to drag enemies to him. Emits a gas cloud when he takes damage.','Take care when traversing the shadowed trails of Duskwood...Ever since Abercrombie the Embalmer unleashed his vile abomination upon Darkshire, Stitches has wandered the road aimlessly, hungering for the flesh of low level Alliance players.',2,true,3000,6.25,500,2,0,0,0.91,1.5,88,27,'Terror of Darkshire');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-03-24',7000,2,'Disables enemy Minions and Structures. Killing enemies replenishes her Withering Fire for continuous damage.','Sylvanas Windrunner was not always the Dark Lady of the Forsaken. In another life, she was the Ranger-General of Silvermoon. But that was before the Death Knight Arthas slew her and her people and raised her as the first Banshee.',2,false,1425,2.97,500,2,0,0,1.67,5.5,90,28,'The Banshee Queen');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,3,'Can grant a temporary Shield to allies, detect nearby enemy Heroes, and manipulate the battlefield for his team.','An Executor without equal, Tassadar has fought tirelessly to purify the Koprulu sector of zerg infestation. Only now, after learning to wield the power of the void, is Tassadar finally ready to face the Overmind and its all-consuming Swarm.',2,false,1484,3.09,500,2,0,0,4,5.5,15,29,'Savior of the Templar');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-06-30',7000,1,'Gathers meat from fallen enemies to gain power, brutally assaulting his enemies.','An unrelenting hacking echoed off the walls of the Cathedral and as Prince Aiden made his way through its depths, the sound only grew louder. There were no screams; just that dreadful sound... over and over.',2,true,2154,4.49,500,2,0,0,1.11,1.5,130,30,'Flesh Carver');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-02-10',10000,5,'Three Heroes in one! Can focus their efforts or split up to cover more ground. Lowered death timers.','The Lost Vikings are back! While they briefly considered retirement after defeating the emperor Tomator, there were only so many polar bears they could wrestle before falling into a Nexus portal seemed like a solid life decision.',4,false,0,0,0,0,0,0,0,0,0,31,'Triple Trouble');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-01-13',4000,2,'Melee heavy hitter with powerful Lightning and Earth spells. Heals himself through Ability casts.','As a child, Thrall served the cruel Aedelas Blackmoore as a slave. After gaining his freedom, he guided the liberated orcs to a land of their own and worked to recover their ancient traditions. Now and forever he is the Warchief of the Horde.',2,true,1876,3.91,500,2,0,0,0.91,1.5,173,32,'Warchief of the Horde');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-18',4000,3,'Attacks enemies with a rapid firing Minigun that ramps up to full speed.','Tychus Findlay is a big man with a big ego and a bigger gun. Fortunately, his loyalty is easily won. Buy him a drink or three and promise him enough credits, and there''s no job in the whole universe too dangerous for this outlaw.',2,false,1925,4.01,500,2,0,0,4,4.5,48,33,'Notorious Outlaw');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,1,'Strong front-line Hero that can support his allies, Shielding them and increasing their Movement Speed. Explodes when he dies damaging nearby enemies.','Among the angels it is the Archangel of Justice Tyrael who is humanity''s greatest defender. Wielding his sword El''druin against the Burning Hells, the Prime Evils would have enslaved humanity long ago if Tyrael had not intervened.',2,true,2468,5.14,500,2,0,0,1.25,1.5,81,34,'Archangel of Justice');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,2,'Marks enemy targets so they take increased damage. Summons owls to scout out enemy positions.','Tyrande Whisperwind strikes fear into all who wish ill of the Kaldorei. As the highest ranking Sentinel and High Priestess of Elune, she is not only the Night Elves'' most deadly warrior, but also their most cunning leader.',2,false,1511,3.15,500,2,0,0,1.33,5.5,82,35,'High Priestess of Elune');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',4000,2,'Heals allies, stuns enemies, and returns as a Spirit to heal after dying.','The first paladin and founder of the Order of the Silver Hand, Uther the Lightbringer is a faithful servant of the Light. Dispensing justice with the swing of his hammer, Uther is a bastion of truth and an unflinching symbol of the Alliance.',1,true,2156,4.49,500,2,0,0,1,1,81,36,'The Lightbringer');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',2000,1,'Strikes at the enemy from afar and gains Hatred, increasing her Movement Speed and Basic Attack damage. Can Vault away if enemies get too close.','Valla witnessed the ferocity of hellspawn firsthand as the demons ravaged her village and left her for dead. Now, with no people to call her own, her only allegiance is to her cause: to rid Sanctuary of the demonic filth corrupting its lands.',1,false,1273,2.65,500,2,0,0,1.67,5.5,75,37,'Demon Hunter');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-06-26',4000,3,'Spreads Creep and summons Zerg minions to assault enemy Structures.','If Kerrigan is the Queen of the Zerg, then Zagara is the mother of the brood. Cunning and tenacious, she commands her minions on the field of battle. Encounter her brood and beware: Mess with her children, and you answer to mama.',2,false,1575,3.3,500,2,0,0,1.25,5.5,85,38,'Broodmother of the Swarm');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2014-03-13',10000,3,'Automatically cloaks while out of combat. Can Blink in and out of combat.','The enigmatic Dark Templar Zeratul serves the Xel''Naga. While he expertly wields the power of the Void, it is his wisdom that earns him the respect of the Koprulu sector''s leaders - despite his penchant for dramatic entrances.',3,true,1622,3.38,500,2,0,0,1.11,1.5,126,39,'Dark Prelate');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-09-08',4000,2,'Fights in tandem with his bear, Misha. Misha is a resilient warrior and protects Rexxar while he attacks from a distance.','It was a strange twist of fate that led the wandering half-ogre Rexxar to the fledgling city of Orgrimmar. With his aid, Thrall and the Horde were able to secure their homeland and defend it from the invading forces of Lord Admiral Daelin Proudmoore.',3,false,1795,3.73,500,2,0,0,0.87,5.5,103,40,'Champion of the Horde');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-10-06',10000,3,'A dedicated support that heals a single ally near her. Shields allies and knocks back enemies.','To good marines, the only thing more important than the rifle in their hand is the medic at their back. As one of the first officers deployed during the United Earth Directorate''s invasion, Lt. Rosa Morales is the best of the best.',2,false,1472,3.07,100,4,0,0,1,5.5,83,41,'Combat Medic');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-10-20',7000,3,'A duelist warrior that gains a shield automatically at low health. Repositions enemies and strikes with his blades.','Despite his relative youth, Artanis was named Hierarch of the Daelaam after the fall of Aiur. Driven by the promise of a brighter future, he hopes to reclaim the protoss'' fallen home world and rebuild their once glorious civilization.Artanis is FREE to purchasers of StarCraft&#1042;&#174; II: Legacy of the Void&#1074;&#8222;&#1118;',2,true,2470,5.14,500,2,0,0,1,1.25,111,42,'Hierarch of the Daelaam');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-11-11',10000,2,'Two-Headed Ogre who is physically attached to Gall. He controls their movement, and must work to keep them alive. Must be played with Gall.','Cho&#1074;&#1026;&#8482;gall is one of the most powerful, intelligent, and insane ogre-magi to have ever lived. As the leader of the Twilight''s Hammer the two brothers seek to bring about an age of destruction... whenever they aren&#1074;&#1026;&#8482;t bickering that is.',2,true,2950,6.14,0,1,0,0,0.91,2,130,43,'Twilight''s Hammer Chieftain');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-11-11',10000,2,'Two-Headed Ogre who is physically attached to Cho, moving where he moves. Can deal incredible amounts of area damage. Must be played with Cho.','Cho&#1074;&#1026;&#8482;gall is one of the most powerful, intelligent, and insane ogre-magi to have ever lived. As the leader of the Twilight''s Hammer the two brothers seek to bring about an age of destruction... whenever they aren&#1074;&#1026;&#8482;t bickering that is.',1,false,3083,6.42,0,1,0,0,0,0,0,44,'Twilight''s Hammer Chieftain');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2015-12-15',7000,2,'A fragile and slippery Dryad who gallops across the battlefield, poisoning enemies to wear them down over time.','While her younger sisters frolicked in idyllic forests, Lunara watched as mortals exploited nature&#1074;&#1026;&#8482;s splendor. On Azeroth, her father Cenarius forbade her from retaliating. But this is the Nexus, and it&#1074;&#1026;&#8482;s time for nature to take its revenge.',2,false,1430,2.98,500,2,0,0,1.11,5.5,90,45,'First Daughter of Cenarius');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-01-12',7000,2,'A shapeshifting Hero who can wear his opponents down from afar, before leaping in as a Worgen to finish them when they''re vulnerable.','Like most Gilneans, Genn Greymane is afflicted by the Worgen curse. Though he feels at fault for his people&#1074;&#1026;&#8482;s ill fate, he has embraced his inner beast without giving in to its feral nature. Now he leads his pack as both their alpha and their king.',3,false,1876,3.91,500,2,0,0,1,5.5,140,46,'Lord of the Worgen');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-02-02',7000,1,'','',0,false,1232,2.57,500,2,0,0,1,5.5,63,47,'Rebellious Wizard');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-03-01',10000,1,'Sturdy spellcaster that cripples enemies with Necromantic magic. Summons Skeletal Warriors from the corpses of enemies.','From the recesses of the eastern jungles comes a man cloaked in mystery. As a member of the secretive Priests of Rathma, or the Necromancers, Xul wields powerful death magic and fights to preserve the delicate balance between order and chaos.',2,true,2000,4.168,500,2,0,0,1.2,1.5,108,48,'Cryptic Necromancer');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-03-29',10000,3,'A devious melee Warrior that can attack from any shrub and grows more durable by collecting the Essence of his enemies.','Cunning and wise, Dehaka is one of the last surviving pack leaders of the forgotten world of Zerus. As with all primal zerg, he is driven by a powerful desire to consume the essence of his foes and evolve into newer and more deadly forms.',3,true,2434,5.0703,500,2,0,0,1.11,1,100,49,'Primal Pack Leader');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-04-19',10000,4,'','Lena Oxton (call sign: &quot;Tracer&quot;), is both an adventurer and an irrepressible force for good. With the ability to alter her own time at will, she fights the good fight wherever she goes--even the Nexus. Don''t worry, loves. The cavalry''s finally here.',3,false,1280,5.33,10,0,0,0,8,5.5,28,50,'Agent of Overwatch');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-05-17',10000,2,'A long ranged mage who delivers devastating blows and manipulates time.','At first glance, Chromie appears to be an ordinary gnome. In truth, she is Chronormu, Bronze Dragon and a master of time. When it comes to temporal manipulation, there''s no problem she can''t solve... with some help from her future self, of course.',3,false,1323,2.76,500,2,0,0,1,5.5,73,51,'Keeper of Time');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-06-14',10000,2,'A strong utility Hero, who can fly over the battlefield as a Raven, setting up his allies with his Portals.','',0,false,1529,3.18,500,2,0,0,1.11,5.5,83,52,'The Last Guardian');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-07-12',7000,2,'A sustained-damage ranged Assassin who consumes his own Health to fuel his Abilities.','Abandoning the ways of shamanism, Gul''dan entered a pact with the demon lord Kil''jaeden and betrayed his people in exchange for limitless power. With the orcish Horde under his master''s thrall, both Draenor and Azeroth nearly fell into his grasp.',2,false,1700,3.54,500,2,0,0,1,5.5,60,53,'Darkness Incarnate');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-08-09',10000,1,'A ranged Support whose healing capabilities are dependent on the damage she and her allies deal','It is through the archangel Auriel that the power of hope flows into the fabric of creation. Her eternal light illuminates even the darkest souls. Seeking harmony in all things, she is a mediator, a counselor, and when the need arises, a fearless warrior.',3,false,1758,3.66,505,4,0,0,1.25,5.5,68,54,'Archangel of Hope');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-09-13',10000,3,'An aberrant melee assassin who can manipulate enemy''s position and punish poor enemy positioning.','Not all heroes are born of altruism... some, like Alarak, simply desire vengeance. As the new Highlord of the Tal''darim, Alarak leads his people to a destiny free of the corrupt influence of the fallen xel''naga, Amon.',3,true,1900,3.96,500,2,0,0,1,1.5,140,55,'Highlord of the Tal''darim');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-09-27',10000,4,'A mid range tank who uses shields to protect herself and allies. Damage absorbed from her shields increases her damage allowing her to dish out incredible damage as she defends her team.','Aleksandra Zaryanova is one of the world''s strongest women and was a promising athlete, but all that changed when the Siberian omnium reawakened. As a soldier in the Russian Defense Force, she now proudly uses her strength to protect the ones she loves.',0,false,2292,4.77,100,4,0,0,4,4.5,22,56,'Defender of Russia');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-10-18',10000,2,'A melee Assassin who uses deceit through creating Mirror Images of himself to stay alive and slice up his foes!','Samuro, the last remaining blademaster to wear the banner of the Burning Blade, is on a warrior''s pilgrimage in search of vengeance and redemption for his fallen clan. It will be a long journey, but he has sworn an oath to restore his clan''s honor.',0,true,1725,3.6,0,1,0,0,1.67,2,110,57,'The Blademaster');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-11-15',10000,2,'An extremely versatile Multi-class Hero that can function as a melee Warrior or Assassin, adapting himself to the needs of his team.','Few would have expected that the gladiator known only as Lo''Gosh was in truth the missing ruler of Stormwind, Varian Wrynn. Now the High King of the Alliance, his every action shapes the destiny of Azeroth itself.',0,true,1924,4.01,500,2,0,0,1.25,1.2,91,58,'High King of the Alliance');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2016-12-14',10000,2,'A Bruiser that can nullify enemy pushes against his Forts and Keeps.','As the lord of Azeroth&#1074;&#1026;&#8482;s fire elementals, Ragnaros desires nothing more than to burn the world to ash. Banished to the Firelands eons ago, the Firelord now turns his rage toward the Nexus, intent on incinerating everything and everyone within it.',2,true,2000,4.17,500,2,0,0,0.83,2,171,59,'The Firelord');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-01-04',10000,2,'Aggressive ranged attacker who gets stronger as his health decreases. Can regenerate health after fights.','',2,false,1875,3.9,500,2,0,0,1.25,5.5,94,60,'Warlord of the Amani');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-01-24',10000,2,'A tricky assassin who gains access to different abilities while stealthed. Builds combo points and Eviscerates her opponents.','For a time, the gladiator Valeera Sanguinar served dutifully as one of Varian Wrynn''s personal bodyguards. Now, her shadowy skills find her a natural fit within the secretive rogue order, the Uncrowned, in their fight against the Legion.',3,true,2047,4.27,100,4,0,0,2,1.25,79,61,'Shadow of the Uncrowned');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-02-14',10000,4,'A highly mobile Support who constantly heals or grants Movement Speed to all allies around him.','From the streets of Rio to the clubs on King''s Row, L&#1043;&#1108;cio''s beats bring the party to life, and drive the people to action. Now he''s on tour in the Nexus, ready to break it down, and to continue fighting for what''s right.',2,false,1442,3,500,2,0,0,0.8,5.5,23,62,'Freedom Fighting DJ');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-03-14',10000,3,'A high damage Summoner that must stay near Pylons to be effective.','Since his activation, Probius has always wanted to prove himself. He may be small, but he made a big difference by warping in a critical pylon during the retaking of Aiur. As the bravest of probes, Probius is eager to fulfill his purpose in the Nexus.',3,false,1310,2.73,600,2,0,0,1.11,3,34,63,'Curious Probe');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-04-04',10000,1,'An Assassin who specializes against Physical Attackers.','',2,false,1660,4,500,2,0,0,1.33,4,130,64,'Amazon Warmatron');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-04-25',10000,4,'An opportunistic, mobile Assassin who can tear apart a weak backline.','Once the carefree youngest scion of the Shimada clan, Genji was cut down by his own brother for refusing to take part in their illegal ventures. Grafted into a cyborg body by Overwatch, Genji walks his own path as one who fights for what''s right.',3,false,1620,3.37,500,2,0,0,1,5.5,44,65,'Cybernetic Ninja');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-05-16',10000,4,'A former pro gamer turned ace mech pilot, D.Va jet-boosts through the Nexus, relying on her powerful cannons and defensive barrier to end skirmishes with a professional''s flair.','Hana Song, also known as &quot;D.Va,&quot; is both a world champion professional gamer and a burgeoning global icon. As a member of South Korea''s elite MEKA unit, she fights to protect her homeland from the colossal omnic threat lurking within the East China Sea.',2,false,1109,2.5664,100,0,0,0,4,5.5,55,66,'MEKA Pilot');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-06-13',10000,1,'An Assassin who marks his enemies, shredding away High Health enemies.','Once the Aspect of Wisdom, Malthael abandoned heaven after the Worldstone''s destruction. In secret, he had resolved to end the Eternal Conflict by becoming a Reaper of Souls and eliminating everything affected by demonic corruption, including humanity.',2,true,1962,4.09,500,2,0,0,0.91,1.5,82,67,'Aspect of Death');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-07-11',10000,3,'','',2,true,1682,3.5,500,2,0,0,0.67,1.5,259,68,'Infested Admiral');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-08-08',10000,2,'A frontline Tank that enters the fray, trying to isolate a single opponent for elimination.','As the new warchief of the Horde, Garrosh is a proud and vicious warrior who rules with an iron fist. His hatred for the Alliance burns like wildfire, and he will stop at nothing to destroy them. By his axe, the orcs will reclaim their rightful glory.',2,true,2061,4.293,500,2,0,0,0.83,1.2,142,69,'Son of Hellscream');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-09-05',10000,2,'A burst damage Mage that locks down enemies and devastates them with powerful combos.','Kel''Thuzad has faithfully served the Lich King both in life and after death. Reanimated as the Archlich of the Scourge and given domain of the Dread Necropolis, Naxxramas, Kel''Thuzad remains Arthas''s most trusted advisor and master of the cold dark.',3,false,1445,3.01,500,2,0,0,1,5.5,72,70,'Archlich of Naxxramas');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-09-26',10000,4,'A versatile Support who helped found the world-protecting team of heroes known as Overwatch.','As a founding member of Overwatch and one of the world''s best snipers, Ana Amari uses her skills to protect the innocent. Though she went MIA after losing her eye, Ana''s sense of duty and responsibility has brought her back to the fight.',3,false,1598,3.32,500,2,0,0,1.33,6.5,30,71,'Veteran Sniper');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-10-17',10000,4,'A mobile assassin that bombards the enemy from afar, and sews chaos with traps and mines.','The destruction of the Australian omnium left the area an irradiated waste and survivors like Jamison Fawkes were greatly affected by radiation. Now as the explosive-obsessed criminal Junkrat, he is renowned for leaving havoc and bedlam in his wake.',2,false,1350,2.81,0,1,0,0,1,5.5,114,72,'Junker Demolitionist');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-11-14',10000,2,'A Healer who shares her Health with allies and can transform into a Dragon to empower her Abilities.','Alexstrasza, the queen of dragons, was empowered by the titans to be the guardian of all life on Azeroth. She has aided mortals time and again, even at great personal cost. Now, she soars across the Nexus, protecting life wherever she finds it.',2,false,1698,3.54,500,0,0,0,1,5.5,73,73,'The Life Binder');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2017-12-12',10000,4,'A skillful Assassin who deals tremendous damage from long range.','Once heir to the Shimada clan''s criminal empire, Hanzo abandoned his birthright after he almost killed his younger brother. He now strives to perfect his skills as a warrior, and sees the Nexus and its endless conflict as the ideal training ground.',1,false,1323,2.76,500,2,0,0,0.67,6.5,173,74,'Master Assassin');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2018-01-09',10000,3,'Blaze is a ranged Tank who specializes in initiating fights and dealing area damage by spreading his flames','Cpl. Miles &quot;Blaze&quot; Lewis has always been drawn to the flame, but it wasn''t until he joined up with Raynor''s Raiders that he put his pyromania to good use. He''s seen his fair share of battles since then, and has never failed to bring the heat.',2,false,2775,5.7812,500,2,0,0,1,4.5,55,75,'Veteran Firebat');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2018-02-06',10000,2,'A mobile Assassin that excels against clustered enemies and prevents their escape.','Maiev Shadowsong stood watch over the imprisoned Betrayer for ten thousand years, and hunted him relentlessly after he was released. Some say she''s determined; others say she''s obsessed. Either way, she will stop at nothing to ensure the security of her world.',3,true,2021,4.21,500,2,0,0,1.11,1.5,145,76,'The Warden');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2018-03-27',10000,3,'A sustained damage Assassin with a regenerating Shield that enables him to efficiently duel his opponents.','As one of the greatest heroes in protoss history, Fenix''s deeds on the battlefield are legendary. After falling to the zerg during the invasion of Aiur, his body was recovered and implanted into a dragoon so he could continue to fight. Not even death can stop Fenix from achieving glory and valor.',2,false,1140,2.38,0,0,0,0,0,0,0,77,'Steward of the Templar');

INSERT INTO HeroDetails(date,price,franchise,info,lore,difficulty,melee,health,healthregen,resource,resourcetype,spellarmor,physicalarmor,attackspeed,attackrange,attackdamage,id,title)
VALUES ('2018-04-24',10000,1,'A burst Healer who excels at preparing battlefield before a fight and can cripple enemies with crowd control.','As an avid scholar, Deckard Cain has dedicated his life to the pursuit of knowledge. He has been an advisor, storyteller, and friend to Sanctuary''s greatest heroes, guiding them through peril time and again. When Deckard speaks, it''s wise to stay awhile and listen.',2,true,1662,3.46,500,2,0,0,0.91,1.5,66,78,'The Last Horadrim');


